import React,{useState, useEffect} from "react";
import Navbar from "../Navbar";
import Sidebar from "../Sidebar.js";
import Footer from "./Footer";
import AddStore from "./AddStore";
import { db } from "../../firebase";

import { collection,onSnapshot } from "firebase/firestore";
import { FaPen } from "react-icons/fa";
import { 
         BsFillEyeFill, 
         BsFillTrashFill
        } from "react-icons/bs";

export default function Store() {
  const [stores, setStores] = useState([]);
    useEffect(() =>{
      onSnapshot(collection(db,"stores"),(snapshot) =>{
        setStores(snapshot.docs.map(doc => doc.data()));
      });
    },[]);


  return (
    <>
      <Sidebar />
      <div className="relative md:ml-64 bg-yellow-100">
        <Navbar />
        {/* Header */}
        <div className="relative bg-yellow-400  md:pt-32 pb-32 pt-12">
          <div className="px-4 md:px-10 mx-auto w-full">
            <div>
              {/* upper slot */}
              <AddStore />

            </div>
          </div>
        </div>

        <div className="px-4 md:px-10 mx-auto w-full -m-24">

          <div className="flex flex-wrap mt-4">
            <div className=" mb-12 xl:mb-0 px-4">
              <div className="relative flex flex-col min-w-0 break-words bg-white w-full mb-6 shadow-lg rounded">
                <div className="rounded-t mb-0 px-4 py-3 border-0">
                  <div className="flex flex-wrap items-center">
                    <div className="relative w-full px-4 max-w-full flex-grow flex-1">
                      <h3 className="font-semibold text-base text-blue-700">
                        All Stores
                      </h3>
                    </div>

                  </div>
                </div>
                <div className="block w-full overflow-x-auto">
                  {/* Projects table */}
                  <table className="items-center w-full bg-transparent border-collapse">
                    <thead>
                      <tr>
                        <th className="px-6 bg-blue-50 text-blue-500 align-middle border border-solid border-blue-100 py-3 text-xs uppercase border-l-0 border-r-0 whitespace-nowrap font-semibold text-left">
                         Person Name
                        </th>

                        <th className="px-6 bg-blue-50 text-blue-500 align-middle border border-solid border-blue-100 py-3 text-xs uppercase border-l-0 border-r-0 whitespace-nowrap font-semibold text-left">
                          Type of Product
                        </th>
                        <th className="px-6 bg-blue-50 text-blue-500 align-middle border border-solid border-blue-100 py-3 text-xs uppercase border-l-0 border-r-0 whitespace-nowrap font-semibold text-left">
                          Quantity
                        </th>
                        <th className="px-6 bg-blue-50 text-blue-500 align-middle border border-solid border-blue-100 py-3 text-xs uppercase border-l-0 border-r-0 whitespace-nowrap font-semibold text-left">
                          Time
                        </th>
                        <th className="px-6 bg-blue-50 text-blue-500 align-middle border border-solid border-blue-100 py-3 text-xs uppercase border-l-0 border-r-0 whitespace-nowrap font-semibold text-left">
                          Action
                        </th>
                      </tr>
                    </thead>
                    <tbody>
                    {stores.map(store =>(
                        <tr className="">
                        <th className="border-t-2 border-blue-100 px-6 align-middle border-l-0 border-r-0 text-xs whitespace-nowrap p-4 text-left">
                        {store.pers_name}
                        </th>
                        <td className="border-t-2 border-blue-100 px-6 align-middle border-l-0 border-r-0 text-xs whitespace-nowrap p-4">
                        {store.product_type}
                        </td>
                        <td className="border-t-2 border-blue-100 px-6 align-middle border-l-0 border-r-0 text-xs whitespace-nowrap p-4">
                        {store.quantity}
                        </td>
                        <td className="border-t-2 border-blue-100 px-6 align-middle border-l-0 border-r-0 text-xs whitespace-nowrap p-4">
                          {/* <BsArrowUpShort className="text-green-500 text-2xl mr-4" /> */}

                          {store.Time}
                        </td>
                        <td className="border-t-2 border-blue-100 px-6 align-middle border-l-0 border-r-0 text-xs whitespace-nowrap p-4">
                          <div className="flex ">
                          <BsFillEyeFill className="text-green-500 text-lg mr-3 cursor-pointer"/>
                          <FaPen  className="text-blue-500 text-lg mr-3 cursor-pointer"/>
                          <BsFillTrashFill   className="text-red-500 text-lg mr-3 cursor-pointer"/>

                          </div>

                        </td>
                      </tr>

                    ))}






                    </tbody>
                  </table>
                </div>
              </div>
            </div>



          </div>
         <Footer />
        </div>
      </div>
    </>
  );
}
